const vitamins = (props) => {
  myFunc = e => {
  e.preventDefault();
  var x = document.getElementById("myProgress");
  x.value = document.getElementById("value").value;
}
  return(
  <div>
      <h1> hello </h1>
      <form>
        <input  type="text" id="value" max="100" />
        <br></br>
        <label for="VitaminA" />VitaminA
        <progress  name="VitaminA" id="myProgress" value="0" max="2000" />
        <button onClick={this.myFunc}>AddValue</button>
      </form>
    </div>
  )
}

export default vitamins;
